import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const AlunoCadastroPage = () => {
  const [formData, setFormData] = useState({
    nome: '',
    idade: '',
    email: '',
    telefone: '',
    peso: '',
    altura: '',
    experiencia: '',
    senha: '',  // Adicionando campo para senha
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
  
    // Verificando se todos os campos estão preenchidos
    if (!formData.nome || !formData.idade || !formData.email || !formData.senha || !formData.peso || !formData.altura || !formData.telefone || !formData.experiencia) {
      alert('Todos os campos são obrigatórios!');
      return;
    }
    
    // Fazendo a requisição para o backend
    const response = await fetch('http://localhost:5000/api/users', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        name: formData.nome,
        email: formData.email,
        password: formData.senha,  // Enviando a senha
        peso: formData.peso,
        altura: formData.altura,
        telefone: formData.telefone,
        experiencia: formData.experiencia,
        user_type: 'aluno',  // Definindo o tipo de usuário como 'aluno'
      }),
    });

    const result = await response.json();
    console.log('Dados do aluno enviados:', result);

    if (response.status === 201) {
      // Redirecionar para a lista de usuários ou outra página após o cadastro
      navigate('/users');
    } else {
      alert('Erro ao cadastrar aluno!');
    }
  };

  return (
    <div>
      <h2>Cadastro de Aluno</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Nome:</label>
          <input
            type="text"
            name="nome"
            value={formData.nome}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label>Idade:</label>
          <input
            type="number"
            name="idade"
            value={formData.idade}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label>Email:</label>
          <input
            type="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label>Telefone:</label>
          <input
            type="tel"
            name="telefone"
            value={formData.telefone}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label>Peso:</label>
          <input
            type="number"
            name="peso"
            value={formData.peso}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label>Altura:</label>
          <input
            type="number"
            name="altura"
            value={formData.altura}
            onChange={handleChange}
            required
          />
        </div>

        <div>
          <label>Nível de Experiência:</label>
          <select
            name="experiencia"
            value={formData.experiencia}
            onChange={handleChange}
            required
          >
            <option value="">Selecione</option>
            <option value="iniciante">Iniciante</option>
            <option value="intermediario">Intermediário</option>
            <option value="avancado">Avançado</option>
          </select>
        </div>

        <div>
          <label>Senha:</label>
          <input
            type="password"
            name="senha"
            value={formData.senha}
            onChange={handleChange}
            required
          />
        </div>

        <button type="submit">Cadastrar Aluno</button>
      </form>
    </div>
  );
};

export default AlunoCadastroPage;
